import React, { Component } from 'react'
import { BrowserRouter, Route } from 'react-router-dom';
import Sumber from './Sumber'
import CreateArticle from './components/Page/CreateArticle';
import ArticleCoverImage from './components/Page/ArticleCoverImage';
import Profile from './components/Page/Profile'
import CreateEvent from './components/Page/CreateEvent';
import Event from './components/Page/Event';
import CardArticle from './components/PartCard/CardArticle';
import CardEvent from './components/PartCard/CardEvent';
import PageCkeEditor from './components/Page/PageCkeEditor';

import DetailArticle from './components/Page/DetailArticle';

export default class Routers extends Component {
  render() {
    return (
      <BrowserRouter>
        <div>

            <Route exact path='/' getComponent={Sumber} />
            <Route path='/home' getComponent={Sumber} />
            <Route path='/:prodId' getComponent={DetailArticle} />
            <Route path='/createarticle' getComponent={CreateArticle}/>
            <Route path='/articlecoverimage' getComponent={ArticleCoverImage}/>
            <Route path='/profile' getComponent={Profile}/>
            <Route path='/createevent' getComponent={CreateEvent}/>
            <Route path='/event' getComponent={Event}/>
            <Route path='/profilearticle' getComponent={CardArticle}/>
            <Route path='/profileevent' getComponent={CardEvent}/>
{/* 
            <Route path='/pageckeeditor' getComponent={PageCkeEditor}/> */}


        </div>
      </BrowserRouter>
    )
  }
}
